import React from "react";
import { useNavigate } from "react-router-dom"; // Importa useNavigate
import "../css/Services.css";

const ServicePackage = ({ title, description, features, isMostPopular }) => {
  const navigate = useNavigate(); // Declara el hook useNavigate

  // Función para navegar al formulario de contacto
  const navigateToContactForm = () => {
    navigate("/contact");
  };

  return (
    <div className={`service-package ${isMostPopular ? "most-popular" : ""}`}>
      <h2>{title}</h2>
      <p>{description}</p>
      <ul>
        {features.map((feature, index) => (
          <li key={index}>{feature}</li>
        ))}
      </ul>
      {/* Usa la función navigateToContactForm para manejar la navegación */}
      <button className="btn" onClick={navigateToContactForm}>
        Solicitar Información
      </button>
      {isMostPopular && <div className="most-popular-badge">Más Vendido</div>}
    </div>
  );
};

const Services = () => {
  return (
    <div className="titu">
      <h1 className="koliko">Soluciones a Medida</h1>
      <p className="gallo">Impulsamos su negocio con soluciones personalizadas y creativas</p>

      <div className="services">
        {/* Resto del código... */}
      </div>
    </div>
  );
};

export default Services;
